import React, {Component} from 'react'

class FooterComponent extends Component {
    render() {
        return (
            <footer className="footer bg-info">
                <span className="text-dark">All Rights Reserved 2021 @JJLZ</span>
            </footer>
        )
    }
}

export default FooterComponent
